import React from 'react';
import Form from './components/Form';
import Image from './components/Image';

import './App.css';

class App extends React.Component {
    render() {
        return (
            <div className="wrapper">
                <h1>My form:</h1>
                <Form buttonText="Submit" />
                <Image />
            </div>
        );
    }
}

export default App;
